For those of you who use spools that are wider than Makerbot's 1kg. This is an extension for the Replicator Mini spool holder made by CT3D.  
&quot;The spools that fit the Makerbot Replicator Mini are small and sometimes you want to hook up the machine to larger spools, but unfortunately these won't fit in the machine.&quot;  
